import React from "react";
import {Tile} from '../tile/Tile';

export const TileList = ({array}) => {
  return (
    <div>
      {array.map((array, index) => {
        return <Tile key={index} name={array.name} description={{...array, name: undefined}} />
      })}
    </div>
  );
};
